import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

const Dashboard = ({ wallet, userRole }) => {
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState("all"); // all, created, submitted

  useEffect(() => {
    // In MVP, we'll load mock data
    // In production, this would call the smart contract
    loadJobs();
  }, []);

  const loadJobs = async () => {
    setLoading(true);
    try {
      // Mock data for MVP
      const mockJobs = [
        {
          id: 1,
          client: "GBWX...abc",
          freelancer: "GCZX...def",
          amount: 500,
          deadline: new Date(Date.now() + 7 * 24 * 60 * 60 * 1000).toISOString(),
          description: "Build a React component library",
          state: 0, // Created
        },
        {
          id: 2,
          client: "GBWX...abc",
          freelancer: "GCZX...def",
          amount: 1000,
          deadline: new Date(Date.now() + 14 * 24 * 60 * 60 * 1000).toISOString(),
          description: "Design a mobile app mockup",
          state: 1, // Submitted
        },
      ];
      setJobs(mockJobs);
    } catch (error) {
      console.error("Error loading jobs:", error);
    } finally {
      setLoading(false);
    }
  };

  const getStatusClass = (state) => {
    const states = {
      0: "status-created",
      1: "status-submitted",
      2: "status-approved",
      3: "status-rejected",
      4: "status-refunded",
    };
    return states[state] || "status-created";
  };

  const getStatusLabel = (state) => {
    const labels = {
      0: "Created",
      1: "Submitted",
      2: "Approved",
      3: "Rejected",
      4: "Refunded",
    };
    return labels[state] || "Unknown";
  };

  const filteredJobs = jobs.filter((job) => {
    if (filter === "created") return job.state === 0;
    if (filter === "submitted") return job.state === 1;
    return true;
  });

  return (
    <div>
      <div className="card">
        <h2>üìä Dashboard</h2>
        <p style={{ color: "#666", marginBottom: "1.5rem" }}>
          Welcome back! {userRole === "client" ? "You can create jobs or manage submissions." : "Browse and apply for jobs."}
        </p>

        {userRole === "client" && (
          <Link to="/create-job" className="btn btn-primary">
            ‚ûï Create New Job
          </Link>
        )}
      </div>

      <div className="card">
        <h3>üéØ My Jobs</h3>

        <div style={{ marginBottom: "1.5rem" }}>
          <label>Filter:</label>
          <select value={filter} onChange={(e) => setFilter(e.target.value)}>
            <option value="all">All Jobs</option>
            <option value="created">Created</option>
            <option value="submitted">Submitted Work</option>
          </select>
        </div>

        {loading ? (
          <div className="loading">Loading jobs...</div>
        ) : filteredJobs.length === 0 ? (
          <p style={{ color: "#999", textAlign: "center", padding: "2rem" }}>No jobs found</p>
        ) : (
          <div className="jobs-grid">
            {filteredJobs.map((job) => (
              <Link key={job.id} to={`/job/${job.id}`} style={{ textDecoration: "none", color: "inherit" }}>
                <div className="job-card">
                  <div className="job-id">Job #{job.id}</div>
                  <p style={{ fontSize: "0.9rem", color: "#666", margin: "0.5rem 0" }}>
                    {job.description.substring(0, 60)}...
                  </p>
                  <div className="job-amount">${job.amount}</div>
                  <div className="job-deadline">
                    ‚è∞ {new Date(job.deadline).toLocaleDateString()}
                  </div>
                  <span className={`job-status ${getStatusClass(job.state)}`}>
                    {getStatusLabel(job.state)}
                  </span>
                </div>
              </Link>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
